using Plots, LinearAlgebra

function train_model(Y,dt,N_sinusoid;lr=0.1,grad_tol=1e-12,max_iter=100000)
    M=length(Y)
    X=collect(Float64,(0:M-1)*dt)
    λ=abs(randn())
    A=randn(N_sinusoid)
    F=randn(N_sinusoid)
    Ω=randn(N_sinusoid)
    iter=0
    loss_hist=Float64[]
    ∂λ_hist=Float64[]
    ∂A_hist=Vector{Float64}[]
    ∂F_hist=Vector{Float64}[]
    ∂Ω_hist=Vector{Float64}[]

    while iter < max_iter
        F_θ(t)=exp(-λ*t)*sum(A[i]*sin(F[i]*t+Ω[i]) for i=1:N_sinusoid)
        Y_hat=F_θ.(X)
        ΔY = Y_hat .- Y
        J= dot(ΔY,ΔY) / M
        println("-------------------")
        println("Iteration: ",iter," loss: ", J)
        ∂λ = -2*sum(ΔY .* X .* Y_hat)/M
        ∂A = [2*sum(ΔY .* exp.(-λ*X) .* sin.(F[j] .* X .+ Ω[j]))/M for j=1:N_sinusoid]
        ∂F = [2*sum(A[j]*ΔY .* exp.(-λ*X) .* cos.(F[j] .* X .+ Ω[j]) .* X)/M for j=1:N_sinusoid]
        ∂Ω = [2*sum(A[j]*ΔY .* exp.(-λ*X) .* cos.(F[j] .* X .+ Ω[j]))/M for j=1:N_sinusoid]

        push!(loss_hist,J)

        push!(∂λ_hist,abs(∂λ))
        push!(∂A_hist,abs.(∂A))
        push!(∂F_hist,abs.(∂F))
        push!(∂Ω_hist,abs.(∂Ω))

        if (abs(∂λ)<grad_tol) && (maximum(abs.(∂A))< grad_tol) && (maximum(abs.(∂F)< grad_tol)) && (maximum(abs.(∂Ω))<grad_tol)
            break
        end

        λ -= lr * ∂λ
        A .-= lr * ∂A
        F .-= lr * ∂F
        Ω .-= lr * ∂Ω
        println("-------------------")
        iter+=1
    end

    if iter == max_iter 
        println("Training has not converged")
    end

    return λ,A,F,Ω,loss_hist,∂λ_hist,∂A_hist,∂F_hist,∂Ω_hist
end


function analytic_integration(λ,A,F,Ω)
    terms = zero(A)
    @. terms = A * (λ * sin(Ω) + F * cos(Ω)) / (F^2 + λ^2)
    return sum(terms)
end

